import React, { useState } from "react";
// helmet
import { Helmet } from "react-helmet-async";
// mui
import { Box, Container, CircularProgress } from "@mui/material";
// components
import { useSettingsContext } from "../../../components/settings";
import Main from "../../../layouts/dashboard/Main";
// section components
import ContactUsHeader from "../../../section/common/contactUsPages/details/ContactUsHeader";
import InboxSection from "../../../section/common/contactUsPages/InboxSection";
import SendInquiry from "../../../section/common/contactUsPages/SendInquiry";

// ----------------------------------------------------------------------------------------

export default function ContactUs() {
  const { themeStretch } = useSettingsContext();

  const [currentTab, setCurrentTab] = useState("sendInquiry");

  const changeTabHandler = (newTab) => {
    setCurrentTab(newTab);
  };

  const TABS = [
    {
      value: "inbox",
      component: <InboxSection />,
    },
    {
      value: "sendInquiry",
      component: <SendInquiry />,
    },
  ];

  // -------------- JSX Code ---------------
  return (
    <>
      <Helmet>
        <title> Contact Us </title>
      </Helmet>

      {/* *********** Start Header  *************** */}
      <Container
        /* sx={{
          px: { xs: "15px", lg: "0px !important" },
        }}*/
        maxWidth={themeStretch ? false : "xl"}
      >
        <ContactUsHeader
          selectedTab={currentTab}
          onChangeTab={changeTabHandler}
        />

        {/* *********** Start OutLet  *************** */}
        <Main sx={{ width: "100%", pt: "40px" }}>
          <Container
            sx={{
              px: { xs: "15px", lg: "0px!important" },
            }}
            maxWidth={themeStretch ? false : "lg"}
          >
            {TABS.map(
              (tab) =>
                tab.value === currentTab && (
                  <Box key={tab.value}> {tab.component} </Box>
                )
            )}
          </Container>
        </Main>
      </Container>
    </>
  );
}
